import React from 'react'

const Recipe = props => {
    return (
        <article style={styles.card}>
            <img src={props.val.image} alt={props.val.title} style={styles.image}/>
            <h4>{props.val.title}</h4>
            <h5>{props.val.servings}</h5>
            <h5>{props.val.readyInMinutes}</h5>
            <h6>{props.diet}</h6>
            <h5>{props.val.healthScore}</h5>
        </article>
    )
};

export default Recipe

const styles = {
    card: {
        width: '200px',
        height: '225px',
        margin: '2%',
        boxShadow: '3px 6px 8px -3px RGBA(52,48,62,.15)',
        backgroundColor: 'white'
    },
    flavor: {
        width: '525px',
        margin: '0',
        padding: '0',
        marginTop: '20px'
    },
    image: {
        width: '180px',
        margin: '10px'
    }
};
